    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from May through August of 1957. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and vegetation control.
    Resource management is outlined; topics include sale of hides. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
